column24:
A heterogenous group of inherited muscular dystrophy without the involvement of nervous system. The disease is characterized by 
MUSCULAR ATROPHY; 
MUSCLE WEAKNESS; 
CONTRACTURE of the elbows; 
ACHILLES TENDON; and posterior cervical muscles; with or without cardiac features. There are several 
INHERITANCE PATTERNS including X-linked (X 
CHROMOSOME), autosomal dominant, and autosomal recessive gene mutations.;2000; for MUSCULAR DYSTROPHY, SCAPULOPERONEAL use MUSCULAR DYSTROPHIES 2000-2004

A group of severe neurodegenerative diseases characterized by intracellular accumulation of autofluorescent wax-like lipid materials (
CEROID; 
LIPOFUSCIN) in neurons. There are several subtypes based on mutations of the various genes, time of disease onset, and severity of the neurological defects such as progressive 
DEMENTIA; 
SEIZURES; and visual failure.;2007 (1983)

A group of severe neurodegenerative diseases characterized by intracellular accumulation of autofluorescent wax-like lipid materials (
CEROID; 
LIPOFUSCIN) in neurons. There are several subtypes based on mutations of the various genes, time of disease onset, and severity of the neurological defects such as progressive 
DEMENTIA; 
SEIZURES; and visual failure.;2007 (1983)

Rare autosomal recessive lissencephaly type 2 associated with congenital 
MUSCULAR DYSTROPHY and eye anomalies (e.g., 
RETINAL DETACHMENT; 
CATARACT; 
MICROPHTHALMOS). It is often associated with additional brain malformations such as 
HYDROCEPHALY and cerebellar hypoplasia and is the most severe form of the group of related syndromes (alpha-dystroglycanopathies) with common congenital abnormalities in the brain, eye and muscle development.;2011

A familial, nontransient 
HYPOGLYCEMIA with defects in negative feedback of GLUCOSE-regulated 
INSULIN release. Clinical phenotypes include 
HYPOGLYCEMIA; 
HYPERINSULINEMIA; 
SEIZURES; 
COMA; and often large 
BIRTH WEIGHT. Several sub-types exist with the most common, type 1, associated with mutations on an 
ATP-BINDING CASSETTE TRANSPORTERS (subfamily C, member 8).;2014(2004)

A condition chiefly characterized by thickening of the skin of the head and distal extremities, deep folds and furrows of the skin of the forehead, cheeks, and scalp, 
SEBORRHEA; 
HYPERHIDROSIS; periostosis of the long bones, digital clubbing, and spadelike enlargement of the hands and feet. It is more prevalent in the male, and is usually first evident during adolescence. Inheritance is primarily autosomal recessive, but an autosomal dominant form exists.;2014(1964)

A group of autosomal recessive disorders marked by a deficiency of the hepatic enzyme 
PHENYLALANINE HYDROXYLASE or less frequently by reduced activity of 
DIHYDROPTERIDINE REDUCTASE (i.e., atypical phenylketonuria). Classical phenylketonuria is caused by a severe deficiency of phenylalanine hydroxylase and presents in infancy with developmental delay; 
SEIZURES; skin 
HYPOPIGMENTATION; 
ECZEMA; and demyelination in the central nervous system. (From Adams et al., Principles of Neurology, 6th ed, p952).;2000(1974)

Rare autosomal recessive syndrome of extreme insulin resistance due to mutations in the binding domain of 
INSULIN RECEPTOR. Clinical features include severe intrauterine and postnatal growth restriction, characteristic dysmorphic 
FACIES; 
HIRSUTISM; 
VIRILIZATION; multiple endocrine abnormalities, and early death.;2010

A degenerative disease of the central nervous system characterized by balance difficulties; 
OCULAR MOTILITY DISORDERS (supranuclear ophthalmoplegia); 
DYSARTHRIA; swallowing difficulties; and axial 
DYSTONIA. Onset is usually in the fifth decade and disease progression occurs over several years. Pathologic findings include neurofibrillary degeneration and neuronal loss in the dorsal 
MESENCEPHALON; 
SUBTHALAMIC NUCLEUS; 
RED NUCLEUS; pallidum; dentate nucleus; and vestibular nuclei. (From Adams et al., Principles of Neurology, 6th ed, pp1076-7);1987

A familial, nontransient 
HYPOGLYCEMIA with defects in negative feedback of GLUCOSE-regulated 
INSULIN release. Clinical phenotypes include 
HYPOGLYCEMIA; 
HYPERINSULINEMIA; 
SEIZURES; 
COMA; and often large 
BIRTH WEIGHT. Several sub-types exist with the most common, type 1, associated with mutations on an 
ATP-BINDING CASSETTE TRANSPORTERS (subfamily C, member 8).;2014(2004)

